import * as React from "react";
import Box from "@mui/material/Box";
import Divider from "@mui/material/Divider";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import Typography from "@mui/material/Typography";
import ListItemText from "@mui/material/ListItemText";

export default function Nav() {
    // Styles and SX
    const boxSx = {
        bgcolor: "background.paper",
        width: "100%"
    };

    const listItemTextStyles = {
        color: "#1769aa",
        fontSize: "36px",
        textAlign: "center"
    };

    const listItemButtonSx = {
        padding: "40px"
    };

    return (
        <Box sx={boxSx}>
            <nav aria-label="medication nav">
                <List>
                    <Divider/>
                    <ListItem disablePadding>
                        <ListItemButton component="a" href="/add-medication" sx={listItemButtonSx}>
                            <ListItemText disableTypography
                                          primary={<Typography style={listItemTextStyles}>Add a
                                              medication</Typography>}/>
                        </ListItemButton>
                    </ListItem>
                    <Divider/>
                    <ListItem disablePadding>
                        <ListItemButton component="a" href="/register-medication" sx={listItemButtonSx}>
                            <ListItemText disableTypography primary={<Typography
                                style={listItemTextStyles}>Add a reminder</Typography>}/>
                        </ListItemButton>
                    </ListItem>
                    <Divider/>
                </List>
            </nav>
        </Box>
    );
}
